    salinity and other variables collected from Surface underway observations using
    Carbon dioxide (CO2) gas analyzer, Shower head chamber equilibrator for autonomous
    carbon dioxide (CO2) measurement and other instruments from Marcus G. Langseth in
    the Aegean Sea, Alboran Sea and others from 2015-04-13 to 2015-11-12 (NCEI Accession
    0144534)",nt"tracking_summary": {ntt"total": 3,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-03-07T18:32:10.088716",nt"name":
    "partial-pressure-or-fugacity-of-carbon-dioxide-salinity-and-other-variables-collected-from-surfe0db2",nt"isopen":
    false,nt"url": null,nt"notes": "NCEI Accession 0144534 includes Surface
    underway data collected from Marcus G. Langseth in the Aegean Sea, Alboran Sea,
    Mediterranean Sea, Mediterranean Sea - Eastern Basin, Mediterranean Sea - Western
    Basin, North Atlantic Ocean and Strait of Gibraltar from 2015-04-13 to 2015-11-12.
    These data include BAROMETRIC PRESSURE, Partial pressure (or fugacity) of carbon
    dioxide - water, SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect
    these data include Carbon dioxide (CO2) gas analyzer and Shower head chamber equilibrator
    for autonomous carbon dioxide (CO2) measurement.nnThese data were collected by Taro
    Takahashi and Stewart Sutherland of Columbia University; Lamont-Doherty Earth Observatory
    and Colm Sweeney of University of Colorado at Boulder; Cooperative Institute for
    Research In Environmental Sciences as part of the VOS_Marcus_Langseth_Lines_2015
    data set. CDIAC associated the following cruise ID(s) with this data set: 33H320150413nnThe
    Global Volunteer Observing Ship (VOS) Program is coordinated by the UNESCO International
    Ocean Carbon Coordination Project (IOCCP). International groups from 14 countries
